import{_ as e,o as a,c as t,O as s}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 46.2-227 Fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-227.md","filePath":"vacode/46.2-227.md"}'),r={name:"vacode/46.2-227.md"},o=s('<h1 id="§-46-2-227-fees" tabindex="-1">§ 46.2-227 Fees. <a class="header-anchor" href="#§-46-2-227-fees" aria-label="Permalink to &quot;§ 46.2-227 Fees.&quot;">​</a></h1><p>A. The Department shall assess a fee of up to $10 per year for each individual who is issued electronic credentials by the Department or is granted access to an electronic credential issued in accordance with an agreement pursuant to the provisions of subsection C of § <a href="/vacode/46.2-226/">46.2-226</a>.</p><p>B. The Department shall assess a fee pursuant to § <a href="/vacode/46.2-214/">46.2-214</a> for searches of the verification system.</p><p>C. Pursuant to § <a href="/vacode/46.2-214/">46.2-214</a>, the fees received by the Department pursuant to this section shall be paid into the state treasury and shall be set aside as a special fund to be used to meet the expenses of the Department.</p><p>2017, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0697" target="_blank" rel="noreferrer">697</a>; 2022, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0183" target="_blank" rel="noreferrer">183</a>.</p>',5),n=[o];function i(c,h,l,p,d,f){return a(),t("div",null,n)}const m=e(r,[["render",i]]);export{u as __pageData,m as default};
